import React, { useState } from "react";
import { useLanguage } from "../contexts/LanguageContext";
import { useTheme } from "../contexts/ThemeContext";
import { Typewriter } from "react-simple-typewriter";
import { motion, AnimatePresence } from "framer-motion";

const Home = () => {
  const { text } = useLanguage();
  const { theme } = useTheme();
  const [isModalOpen, setIsModalOpen] = useState(false);

  const toggleModal = () => {
    setIsModalOpen(!isModalOpen);
  };

  return (
    <section
      id="home"
      className={`relative min-h-screen flex flex-col items-center justify-center overflow-hidden ${
        theme === "light"
          ? "bg-light-background text-light-text"
          : "bg-dark-background text-dark-text"
      }`}
    >
      {/* Animated Background */}
      <div className="absolute inset-0">
        <div className={`absolute inset-0 bg-gradient-to-br ${
          theme === "light"
            ? "from-blue-50/50 to-indigo-50/50"
            : "from-blue-900/20 to-indigo-900/20"
        } animate-gradient-x`} />
        <div className="absolute inset-0 bg-[radial-gradient(circle_at_center,_var(--tw-gradient-stops))] from-transparent via-transparent to-current/5" />
      </div>

      <div className="relative z-10 text-center px-4">
        {/* Profile Image */}
        <motion.div
          initial={{ scale: 0.8, opacity: 0 }}
          animate={{ scale: 1, opacity: 1 }}
          transition={{ duration: 0.5 }}
          className="mb-8"
        >
          <div className={`w-32 h-32 mx-auto rounded-full overflow-hidden border-4 ${
            theme === "light"
              ? "border-light-accent/20"
              : "border-dark-accent/20"
          }`}>
            <img
              src="/profile.jpg"
              alt="Profile"
              className="w-full h-full object-cover"
            />
          </div>
        </motion.div>

        {/* Name and Title */}
        <motion.h1
          initial={{ y: 20, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 0.2, duration: 0.5 }}
          className={`text-5xl font-bold mb-4 bg-clip-text text-transparent bg-gradient-to-r ${
            theme === "light"
              ? "from-light-accent to-blue-600"
              : "from-dark-accent to-cyan-400"
          }`}
        >
          {text.home.name}
        </motion.h1>

        {/* Typewriter Effect */}
        <motion.h2
          initial={{ y: 20, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 0.4, duration: 0.5 }}
          className="text-3xl font-medium mt-2"
        >
          {text.home.staticPhrase}{" "}
          <span className={`font-bold ${
            theme === "light" ? "text-light-accent" : "text-dark-accent"
          }`}>
            <Typewriter
              words={text.home.typewriter}
              loop={true}
              cursor
              cursorStyle="|"
              typeSpeed={70}
              deleteSpeed={50}
              delaySpeed={1500}
            />
          </span>
        </motion.h2>

        {/* Intro Text */}
        <motion.p
          initial={{ y: 20, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 0.6, duration: 0.5 }}
          className={`text-lg mt-6 max-w-2xl mx-auto ${
            theme === "light" ? "text-light-secondary" : "text-dark-muted"
          }`}
        >
          {text.home.intro}
        </motion.p>

        {/* Action Buttons */}
        <motion.div
          initial={{ y: 20, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 0.8, duration: 0.5 }}
          className="mt-12 flex flex-wrap justify-center gap-4"
        >
          <motion.a
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            href="https://www.linkedin.com/in/yutaka-yamaguchi"
            target="_blank"
            rel="noopener noreferrer"
            className={`px-6 py-3 rounded-xl font-semibold shadow-lg backdrop-blur-sm border ${
              theme === "light"
                ? "bg-light-accent text-white border-light-accent/20 hover:bg-light-hover"
                : "bg-dark-accent text-white border-dark-accent/20 hover:bg-dark-hover"
            } transition-all duration-300`}
          >
            {text.home.buttons.linkedin}
          </motion.a>
          <motion.a
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            href="https://github.com/yyamaguchi0102?tab=repositories"
            target="_blank"
            rel="noopener noreferrer"
            className={`px-6 py-3 rounded-xl font-semibold shadow-lg backdrop-blur-sm border ${
              theme === "light"
                ? "bg-light-card text-light-text border-light-border hover:bg-light-border/50"
                : "bg-dark-card text-dark-text border-dark-border hover:bg-dark-border/50"
            } transition-all duration-300`}
          >
            {text.home.buttons.github}
          </motion.a>
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            onClick={toggleModal}
            className={`px-6 py-3 rounded-xl font-semibold shadow-lg backdrop-blur-sm border ${
              theme === "light"
                ? "bg-light-card text-light-text border-light-border hover:bg-light-border/50"
                : "bg-dark-card text-dark-text border-dark-border hover:bg-dark-border/50"
            } transition-all duration-300`}
          >
            {text.home.buttons.aboutMe}
          </motion.button>
        </motion.div>
      </div>

      {/* Modal */}
      <AnimatePresence>
        {isModalOpen && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="fixed inset-0 flex items-center justify-center bg-black/50 backdrop-blur-sm z-50"
            onClick={toggleModal}
          >
            <motion.div
              initial={{ scale: 0.9, opacity: 0 }}
              animate={{ scale: 1, opacity: 1 }}
              exit={{ scale: 0.9, opacity: 0 }}
              className={`p-8 rounded-2xl shadow-xl max-w-2xl mx-4 ${
                theme === "light"
                  ? "bg-light-card text-light-text"
                  : "bg-dark-card text-dark-text"
              }`}
              onClick={(e) => e.stopPropagation()}
            >
              <h2 className={`text-3xl font-bold mb-6 ${
                theme === "light" ? "text-light-accent" : "text-dark-accent"
              }`}>
                {text.home.about.title}
              </h2>
              <p className="leading-relaxed mb-6">{text.home.about.content}</p>
              <motion.button
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                onClick={toggleModal}
                className={`px-4 py-2 rounded-xl font-medium ${
                  theme === "light"
                    ? "bg-light-accent text-white hover:bg-light-hover"
                    : "bg-dark-accent text-white hover:bg-dark-hover"
                } transition-all duration-300`}
              >
                {text.home.about.close}
              </motion.button>
            </motion.div>
          </motion.div>
        )}
      </AnimatePresence>
    </section>
  );
};

export default Home;
